/** ************************************************************************
 * File: react-app-env.d.ts
 *
 * Logic: This TypeScript declaration file defines module declarations for
 * various image file types (PNG, SVG, JPEG, JPG). It allows you to import these
 * image files in your TypeScript/React application without type errors.
 *
 * Type: TypeScript Declarations
 *************************************************************************/



declare module '*.png';
declare module '*.svg';
declare module '*.jpeg';
declare module '*.jpg';
